import React, { useEffect, useState } from 'react'
import axios from "axios";
export const Albums = () => {
    const [albums, setAlbums] = useState([]);


    useEffect(()=>{
        const fetchAllAlbums = async () =>{
            try{
                const res = await axios.get("http://localhost:8800/albums")
                console.log(res);
            }
            catch(err){
                console.log(err);
            }
        }
        fetchAllAlbums();
    },[])
  return (
    <div>Albums</div>
  )
}
